label("6",(9,0),S); label("3",(7.5,4),S); label("4",(6,2),W); label("5",(10.5,2),NE);

[/asy]

$\triangle CO_1A$ and $\triangle CO_2B$ are similar, so \[\frac{CO_1}{CO_2} = \frac{CA}{CB}=\frac{O_1A}{O_2B}=\frac{3}{6}.\]Thus $CO_1=4$ and $CA=5$ (and we see the small removed cone has half the height of the full cone).  Also, $CB=10$.

Now we unroll the lateral surface area of the full cone.  (The desired frustum lateral area is shown in blue.)

[asy]
unitsize(0.2 cm);

import graph;
defaultpen(linewidth(.8)+fontsize(10));
fill(Arc((0,0),10,0,240)--cycle,heavycyan); fill(Arc((0,0),5,0,240)--cycle,white); fill((5,0)--(10,0)--(-5,-5*sqrt(3))--(-2.5,-2.5*sqrt(3))--cycle,white);
draw(Arc((0,0),10,0,240)); draw(Arc((0,0),5,0,240));
draw(Arc((0,0),10,240,360),linetype("2 4")); draw(Arc((0,0),5,240,360),linetype("2 4"));

draw((10,0)--(0,0)--(-5,-5*sqrt(3)));

label("$C$",(0,0),SE); label("$A$",(5,0),SE); label("$B$",(10,0),SE); label("10",(-2.5,-2.5*sqrt(3)),SE);

[/asy]

When unrolled, the full cone's lateral surface area is a sector whose arc length is the cone's base perimeter and whose radius is the cone's slant height.  So, the sector has arc length $2\cdot \pi \cdot 6 = 12\pi$ and radius $10$.  A full circle with radius 10 has arc length $2\cdot \pi \cdot 10 = 20\pi$, so the sector has $\frac{12\pi}{20\pi}=\frac{3}{5}$ of the circle's arc length and thus has 3/5 of the circle's area.  Thus, the full cone has lateral surface area \[\frac{3}{5}\pi (10^2) = 60\pi.\]Similarly, the small removed cone's lateral surface area is a sector with radius 5 and arc length $2\cdot \pi \cdot 3 = 6\pi$ (which is $3/5$ of the arc length of a full circle with radius 5), so its lateral surface area is \[\frac{3}{5}\pi (5^2)=15\pi.\]The lateral surface area of the frustum, in blue, is the full cone's lateral surface area minus the small removed cone's lateral surface area, which is \[60\pi-15\pi=45\pi.\]

