from collections import Counter


def parse(formula, i):
    counts = Counter()
    while i[0] < len(formula):
        if formula[i[0]] == '(':
            i[0] += 1
            temp = parse(formula, i)
            count = 0
            while i[0] < len(formula) and formula[i[0]].isdigit():
                count = count * 10 + int(formula[i[0]])
                i[0] += 1
            if count == 0:
                count = 1
            for name, c in temp.items():
                counts[name] += c * count
        elif formula[i[0]] == ')':
            i[0] += 1
            return counts
        else:
            name = formula[i[0]]
            i[0] += 1
            while i[0] < len(formula) and formula[i[0]].islower():
                name += formula[i[0]]
                i[0] += 1
            count = 0
            while i[0] < len(formula) and formula[i[0]].isdigit():
                count = count * 10 + int(formula[i[0]])
                i[0] += 1
            if count == 0:
                count = 1
            counts[name] += count
    return counts


def countOfAtoms(formula):
    i = [0]
    counts = parse(formula, i)
    ans = []
    for name, count in counts.items():
        ans.append(name)
        if count > 1:
            ans.append(str(count))
    return ''.join(ans)

Here's a JavaScript program that compresses and decompresses a string using the Run Length Encoding (RLE) algorithm:

```javascript
function compress(inputStr) {
  let compressed = '';
  let count = 1;

  for (let i = 0; i < inputStr.length; i++) {
    if (inputStr[i] === inputStr[i + 1]) {
      count++;
    } else {
      compressed += count > 1 ? count + inputStr[i] : inputStr[i];
      count = 1;
    }
  }

  return compressed;
}

function decompress(compressedStr) {
  let decompressed = '';
  let count = '';

  for (let i = 0; i < compressedStr.length; i++) {
    const char = compressedStr[i];

    if (isNaN(char)) {
      decompressed += count ? char.repeat(parseInt(count, 10)) : char;
      count = '';
    } else {
      count += char;
    }
  }

  return decompressed;
}

// Example usage:
const inputStr = 'aaabbbbbcc';
const compressedStr = compress(inputStr);
console.log('Compressed:', compressedStr); // Output: "3a5b2c"

const decompressedStr = decompress(compressedStr);
console.log('Decompressed:', decompressedStr); // Output: "aaabbbbbcc"
```

This program defines two functions `compress` and `decompress`. The `compress` function takes an input string and compresses it using the RLE algorithm. The `decompress` function takes a compressed string and decompresses it back to its original form.

In the example usage, we have an input string `'aaabbbbbcc'`, which is compressed into `'3a5b2c'`. Then, the compressed string is decompressed back into the original input string `'aaabbbbbcc'`.

from flask import Flask, request, jsonify
from flask_sqlalchemy import SQLAlchemy

app = Flask(__name__)
app.config['SQLALCHEMY_DATABASE_URI'] = 'sqlite:///books.db'
db = SQLAlchemy(app)

# Define the Book model
class Book(db.Model):
    id = db.Column(db.Integer, primary_key=True)
    title = db.Column(db.String(100), nullable=False)
    author = db.Column(db.String(50), nullable=False)
    published_year = db.Column(db.Integer, nullable=False)

    def __repr__(self):
        return f"Book('{self.title}', '{self.author}', {self.published_year})"

# Get all books
@app.route('/api/books', methods=['GET'])
def get_books():
    books = Book.query.all()
    return jsonify([book.__dict__ for book in books])

# Get a specific book
@app.route('/api/books/<int:book_id>', methods=['GET'])
def get_book(book_id):
    book = Book.query.get_or_404(book_id)
    return jsonify(book.__dict__)

# Create a new book
@app.route('/api/books', methods=['POST'])
def create_book():
    data = request.get_json()
    new_book = Book(title=data['title'], author=data['author'], published_year=data['published_year'])
    db.session.add(new_book)
    db.session.commit()
    return jsonify(new_book.__dict__), 201

# Update an existing book
@app.route('/api/books/<int:book_id>', methods=['PUT'])
def update_book(book_id):
    data = request.get_json()
    book = Book.query.get_or_404(book_id)
    book.title = data['title']
    book.author = data['author']
    book.published_year = data['published_year']
    db.session.commit()
    return jsonify(book.__dict__)

# Delete a book
@app.route('/api/books/<int:book_id>', methods=['DELETE'])
def delete_book(book_id):
    book = Book.query.get_or_404(book_id)
    db.session.delete(book)
    db.session.commit()
    return '', 204

if __name__ == '__main__':
    app.run(debug=True)

Here's the JavaScript function that takes an array of integers as input and returns an object with keys representing unique numbers in the array and values representing their frequency count:

```javascript
function countFrequency(arr) {
  const freqCount = {};

  for (const num of arr) {
    if (freqCount.hasOwnProperty(num)) {
      freqCount[num]++;
    } else {
      freqCount[num] = 1;
    }
  }

  return freqCount;
}
```

