def max_hourglass_sum(grid):
    m, n = len(grid), len(grid[0])
    max_sum = float('-inf')
    for i in range(1, m - 1):
        for j in range(1, n - 1):
            sum = grid[i-1][j-1] + grid[i-1][j] + grid[i-1][j+1] \
                + grid[i][j] \
                + grid[i+1][j-1] + grid[i+1][j] + grid[i+1][j+1]
            max_sum = max(max_sum, sum)
    return max_sum

