def fourSumCount(nums1, nums2, nums3, nums4):
    hashMap = {}
    count = 0

    for i in nums1:
        for j in nums2:
            hashMap[i + j] = hashMap.get(i + j, 0) + 1

    for k in nums3:
        for l in nums4:
            count += hashMap.get(-(k + l), 0)

    return count
```
explanation
The algorithm follows these steps to solve the problem:
1. Create an empty hashmap to store the sum of two integers and their frequency.
2. Iterate through the first two arrays nums1 and nums2, calculate their sum and store their frequency in the hashmap.
3. Iterate through the third and fourth arrays nums3 and nums4, and for each pair of elements, calculate their sum, and check if the negative of this sum exists in the hashmap. If it exists, add the frequency of that sum to the result count.
4. Finally, return the count.

#include <iostream>
