Here's a simple C# console application that reads the input file, calculates the sum and average of each line, and writes the results to an output file:

```csharp
using System;
using System.IO;

namespace SumAndAverageCalculator
{
    class Program
    {
        static void Main(string[] args)
        {
            if (args.Length != 2)
            {
                Console.WriteLine("Usage: SumAndAverageCalculator <input_file> <output_file>");
                return;
            }

            string inputFile = args[0];
            string outputFile = args[1];

            try
            {
                using StreamReader reader = new StreamReader(inputFile);
                using StreamWriter writer = new StreamWriter(outputFile);

                string line;
                while ((line = reader.ReadLine()) != null)
                {
                    string[] numbersStr = line.Split(' ');
                    int sum = 0;
                    int count = 0;

                    foreach (string numberStr in numbersStr)
                    {
                        if (int.TryParse(numberStr, out int number))
                        {
                            sum += number;
                            count++;
                        }
                    }

                    double average = count > 0 ? (double)sum / count : 0;
                    writer.WriteLine($"Sum: {sum}, Average: {average}");
                }
            }
            catch (Exception ex)
            {
                Console.WriteLine($"Error processing files: {ex.Message}");
            }
        }
    }
}
```

