```javascript
function intersection(arr1, arr2) {
  const map = {};
  const result = [];

  for (let i = 0; i < arr1.length; i++) {
    if (!map[arr1[i]]) {
      map[arr1[i]] = 1;
    }
  }

  for (let j = 0; j < arr2.length; j++) {
    if (map[arr2[j]]) {
      result.push(arr2[j]);
      map[arr2[j]] = 0;
    }
  }

  return result;
}

// Example usage:
const array1 = [1, 2, 3, 4];
const array2 = [3, 4, 5, 6];

console.log(intersection(array1, array2)); // Output: [3, 4]
```

This function first creates an object `map` to store the elements of the first input array. Then, it iterates through the second input array and checks if each element is present in the `map`. If it is, the element is added to the `result` array and its value in the `map` is set to 0 to avoid duplicates. Finally, the function returns the `result` array containing the intersection of the two input arrays.

The time complexity of this function is O(n), as it only iterates through both input arrays once.

