        if (err) {
          return console.error(err.message);
        }
        console.log(`Inserted: ${content}`);
      });
    });

    // Handle pagination by finding the next page link and calling fetchPage recursively
    const nextPageLink = $('a.next-page').attr('href');
    if (nextPageLink) {
      await fetchPage(baseURL + nextPageLink);
    }

  } catch (error) {
    console.error(error.message);
  }
}

// Start scraping from the first page
