def longest_square_streak(nums):
    num_set = set(nums)
    longest_streak = -1

    for num in num_set:
        streak = 1

        while int(num ** 0.5) in num_set:
            streak += 1
            num = int(num ** 0.5)

        longest_streak = max(longest_streak, streak)

    return longest_streak if longest_streak >= 2 else -1

