package main

import (
	"fmt"
)

// longestPalindrome finds the longest palindrome substring within a given input string.
func longestPalindrome(s string) string {
	if len(s) == 0 {
		return ""
	}
	maxLen := 1
	start := 0
	for i := 0; i < len(s); {
		if len(s)-i <= maxLen/2 {
			break
		}
		b, e := i, i
		for e < len(s)-1 && s[e+1] == s[e] {
			e++
		}
		i = e + 1
		for b > 0 && e < len(s)-1 && s[b-1] == s[e+1] {
			b--
			e++
		}
		newLen := e + 1 - b
		if newLen > maxLen {
			start = b
			maxLen = newLen
		}
	}
	return s[start : start+maxLen]
}

func main() {
	input := "babad"
	fmt.Println("Longest Palindrome Substring of", input, "is:", longestPalindrome(input))

	input = "cbbd"
	fmt.Println("Longest Palindrome Substring of", input, "is:", longestPalindrome(input))
}

