```

### 2. Set up your Azure SQL Database

Follow the instructions provided by Microsoft to create an Azure SQL Database and obtain the connection string:

https://docs.microsoft.com/en-us/azure/sql-database/sql-database-single-database-get-started?tabs=azure-portal

### 3. Configure environment variables

Set the following environment variables with the appropriate values from your Azure SQL Database connection string:

- `AZURE_SQL_SERVER`: The server name
