Create a class called `DatabaseManager` to handle the database connection and CRUD operations:

```java
import java.sql.Connection;
import java.sql.DriverManager;
import java.sql.ResultSet;
import java.sql.SQLException;
import java.sql.Statement;

public class DatabaseManager {
    private Connection connection;

    public void connect() throws SQLException {
        String server = System.getenv("AZURE_SQL_SERVER");
        String database = System.getenv("AZURE_SQL_DATABASE");
        String user = System.getenv("AZURE_SQL_USER");
        String password = System.getenv("AZURE_SQL_PASSWORD");

        String connectionString = "jdbc:sqlserver://" + server + ";database=" + database + ";user=" + user + ";password=" + password;
        connection = DriverManager.getConnection(connectionString);
    }

    // Implement CRUD operations here
}
```

Now you can implement the CRUD operations as methods in the `DatabaseManager` class. For example, to create a table called `Person` with columns for name and age:

```java
public void createTable() throws SQLException {
    String sql = "CREATE TABLE Person (id INT PRIMARY KEY IDENTITY(1, 1), name NVARCHAR(50) NOT NULL, age INT NOT NULL)";
    try (Statement statement = connection.createStatement()) {
        statement.execute(sql);
    }
}

public void insertPerson(String name, int age) throws SQLException {
    String sql = "INSERT INTO Person (name, age) VALUES ('" + name + "', " + age + ")";
    try (Statement statement = connection.createStatement()) {
        statement.executeUpdate(sql);
    }
}

public void updatePerson(int id, String newName, int newAge) throws SQLException {
    String sql = "UPDATE Person SET name='" + newName + "', age=" + newAge + " WHERE id=" + id;
    try (Statement statement = connection.createStatement()) {
        statement.executeUpdate(sql);
    }
}

public void deletePerson(int id) throws SQLException {
    String sql = "DELETE FROM Person WHERE id=" + id;
    try (Statement statement = connection.createStatement()) {
        statement.executeUpdate(sql);
    }
}

public void listPersons() throws SQLException {
    String sql = "SELECT * FROM Person";
    try (Statement statement = connection.createStatement()) {
        ResultSet resultSet = statement.executeQuery(sql);
        while (resultSet.next()) {
            int id = resultSet.getInt("id");
            String name = resultSet.getString("name");
            int age = resultSet.getInt("age");
            System.out.println(id + ": " + name + ", " + age);
        }
    }
}
```

