def min_absolute_difference(nums, queries):
    result = []

    for query in queries:
        left, right = query
        unique = list(set(nums[left:right + 1]))

        if len(unique) == 1:
            result.append(-1)
        else:
            unique.sort()
            min_diff = float('inf')
            for i in range(1, len(unique)):
                min_diff = min(min_diff, unique[i] - unique[i - 1])

            result.append(min_diff)

    return result

