Here's an outline of how you could structure your program:

1. Read input data from a file.
2. Initialize the population of solutions (routes).
3. Evaluate the fitness of each solution.
4. Select parents based on their fitness.
5. Perform crossover and mutation operations to generate offspring.
6. Replace the old population with the new one.
7. Repeat steps 3-6 until a stopping criterion is met (e.g., maximum number of generations or no improvement in the best solution).
8. Output the best solution found.

Below are some code snippets that demonstrate key parts of this process:

1. Reading input data from a file:
```cpp
#include <iostream>
#include <fstream>
#include <vector>

struct City {
    int id;
    double x, y;
};

std::vector<City> read_cities_from_file(const std::string& filename) {
    std::ifstream input_file(filename);
    if (!input_file.is_open()) {
        std::cerr << "Error opening file: " << filename << std::endl;
        exit(1);
    }

    std::vector<City> cities;
    int id;
    double x, y;
    while (input_file >> id >> x >> y) {
        cities.push_back({id, x, y});
    }
    return cities;
}
```

2. Initializing the population of solutions:
```cpp
#include <algorithm>
#include <random>

std::vector<std::vector<int>> initialize_population(int num_individuals, int num_cities) {
    std::vector<int> initial_route(num_cities);
    std::iota(initial_route.begin(), initial_route.end(), 0);

    std::vector<std::vector<int>> population(num_individuals);
    for (int i = 0; i < num_individuals; ++i) {
        std::shuffle(initial_route.begin(), initial_route.end(), std::mt19937{std::random_device{}()});
        population[i] = initial_route;
    }
    return population;
}
```

3. Evaluating the fitness of each solution:
```cpp
double calculate_distance(const City& a, const City& b) {
    double dx = a.x - b.x;
    double dy = a.y - b.y;
    return std::sqrt(dx * dx + dy * dy);
}

double route_fitness(const std::vector<City>& cities, const std::vector<int>& route) {
    double total_distance = 0.0;
    for (size_t i = 1; i < route.size(); ++i) {
        total_distance += calculate_distance(cities[route[i - 1]], cities[route[i]]);
    }
    total_distance += calculate_distance(cities[route.back()], cities[route.front()]);
    return 1 / total_distance;
}
```

4-6. Selecting parents, performing crossover and mutation, and replacing the old population:
You can use libraries like [GAUL](http://gaul.sourceforge.net/) or [EO](https://eodev.github.io/eo/index.html) to implement these steps.

7. Stopping criterion: You can set a maximum number of generations or check if there is no improvement in the best solution found after a certain number of iterations.

8. Outputting the best solution found:
```cpp
void print_best_solution(const std::vector<City>& cities, const std::vector<int>& best_route) {
    std::cout << "Best route found:" << std::endl;
    for (int city_id : best_route) {
