class LRUCache:
    def __init__(self, max_size):
        self.cache = {}
        self.max_size = max_size or 1
        self.lru = []

    def put(self, key, value):
        if key in self.cache:
            self.lru.remove(key)
        elif len(self.cache) >= self.max_size:
            least_recently_used_key = self.lru.pop(0)
            del self.cache[least_recently_used_key]
        self.cache[key] = value
        self.lru.append(key)

    def get(self, key):
        if key not in self.cache:
            return None
        self.lru.remove(key)
        self.lru.append(key)
        return self.cache[key]

    def delete(self, key):
        if key in self.cache:
            self.lru.remove(key)
            del self.cache[key]

