```python
from collections import deque

class PhoneDirectory:
    def __init__(self, maxNumbers: int):
        self.available = [True] * maxNumbers
        self.released = deque()

    def get(self) -> int:
        if self.released:
            number = self.released.popleft()
            self.available[number] = False
            return number
        for i in range(len(self.available)):
            if self.available[i]:
                self.available[i] = False
                return i
        return -1

    def check(self, number: int) -> bool:
        return self.available[number]

    def release(self, number: int) -> None:
        if not self.available[number]:
            self.available[number] = True
            self.released.append(number)
```

explanation
The algorithm uses an array of booleans called `available` with a size of `maxNumbers` to represent each slot's availability (true means available, and false means occupied). Additionally, it uses a queue called `released` to store numbers that have been released recently.

- When the phone directory is initialized, all `available` slots are set to `true`, and the `released` queue is empty.
- When `get()` is called, it returns the first available number. If there is a recently released number in the `released` queue, it assigns this number to the caller and removes it from the queue. If there are no recently released numbers, it simply finds the first available number in the `available` array, sets it to `false`, and returns it. If no number is available, it returns `-1`.
- When `check()` is called, it returns the value of `available[number]` (true or false).
- When `release()` is called, it sets the value of `available[number]` to `true` and enqueues this number to the `released` queue if the slot is not already available.

This solution ensures that each operation (get, check, and release) has an O(maxNumbers) complexity in the worst case, meeting the requirement given the constraints.

