def minScore(s, t):
    m, n = len(s), len(t)
    dp = [[1e6]*(n+1) for _ in range(m+1)]
    dp[0][0] = 0
    for i in range(m):
        for j in range(n):
            if s[i] == t[j]:
                dp[i+1][j+1] = min(dp[i+1][j+1], dp[i][j])
            else:
                dp[i+1][j] = min(dp[i+1][j], dp[i][j] + 1)
    ans = 1e6
    for i in range(m):
        ans = min(ans, dp[i+1][n])
    return int(ans)

