Triangle $POD$ is a 30-60-90 triangle, so $DO = \frac{\sqrt{3}}{2}$ and $DP = \frac12$.  Therefore, the coordinates of $P$ are $\left(\frac{\sqrt{3}}{2}, \frac12\right)$, so $\tan 30^\circ = \frac{\sin 30^\circ}{\cos 30^\circ} = \frac{1/2}{\sqrt{3}/2} = \frac{1}{\sqrt{3}} = \frac{\sqrt{3}}{3}$.

Let $F_1=(7,0)$ and $F_2=(-7,0)$ be the two foci. We know that if the hyperbola has equation \[\frac{x^2}{a^2} - \frac{y^2}{b^2} = 1,\]then for any point $P$ on the hyperbola, we have $|PF_1 - PF_2| = 2a.$ We are given that the point $P=(2,12)$ lies on the hyperbola. We have $PF_1 = \sqrt{(7-2)^2 + (12-0)^2} = 13$ and $PF_2 = \sqrt{(-7-2)^2 + (12-0)^2} = 15,$ so $|PF_1 - PF_2| = |13-15| = 2.$ Thus, $2 = 2a,$ so $a = 1.$

Now, the distance from the center of the hyperbola (the origin) to each focus is $7,$ so we have $a^2 + b^2 = 7^2 = 49.$ Substituting $a=1,$ we get $1 + b^2 = 49,$ so $b = \sqrt{48} = 4\sqrt{3}.$ Thus, $(a, b) = (1, 4\sqrt3).$
