To create a Golang REST API server with the specified requirements, follow these steps:

1. Install required packages and tools

First, make sure you have Go installed on your machine. You can download it from https://golang.org/dl/. Then, install the following packages:

- Gorilla Mux for routing: `go get -u github.com/gorilla/mux`
- pq driver for PostgreSQL: `go get -u github.com/lib/pq`

2. Set up the PostgreSQL database

Create a new PostgreSQL database and table to store book information. The SQL command should look like this:

```sql
CREATE TABLE books (
    id SERIAL PRIMARY KEY,
    title VARCHAR(100) NOT NULL,
    author VARCHAR(100) NOT NULL,
    publication_year INT NOT NULL,
    genre VARCHAR(50) NOT NULL
);
```

3. Create the main.go file

In your project folder, create a `main.go` file and import the necessary packages:

```go
package main

import (
	"database/sql"
	"encoding/json"
	"fmt"
	"log"
	"net/http"

	"github.com/gorilla/mux"
	_ "github.com/lib/pq"
)

const (
	host     = "localhost"
	port     = 5432
	user     = "your_user"
	password = "your_password"
	dbname   = "your_db_name"
)

type Book struct {
	ID              int    `json:"id"`
	Title           string `json:"title"`
	Author          string `json:"author"`
	PublicationYear int    `json:"publication_year"`
	Genre           string `json:"genre"`
}

var db *sql.DB

func main() {
	psqlInfo := fmt.Sprintf("host=%s port=%d user=%s password=%s dbname=%s sslmode=disable",
		host, port, user, password, dbname)

	var err error
	db, err = sql.Open("postgres", psqlInfo)
	if err != nil {
		panic(err)
	}
	defer db.Close()

	err = db.Ping()
	if err != nil {
		panic(err)
	}

	router := mux.NewRouter()
	router.HandleFunc("/books", getBooks).Methods("GET")
	router.HandleFunc("/books/{id}", getBook).Methods("GET")
	router.HandleFunc("/books", createBook).Methods("POST")
	router.HandleFunc("/books/{id}", updateBook).Methods("PUT")
	router.HandleFunc("/books/{id}", deleteBook).Methods("DELETE")

	log.Fatal(http.ListenAndServe(":8000", router))
}
```

4. Implement the API endpoints

Now, implement the functions for each endpoint:

```go
func getBooks(w http.ResponseWriter, r *http.Request) {
	w.Header().Set("Content-Type", "application/json")
	var books []Book

	result, err := db.Query("SELECT id, title, author, publication_year, genre FROM books")
	if err != nil {
		panic(err.Error())
	}
	defer result.Close()

	for result.Next() {
		var book Book
		err := result.Scan(&book.ID, &book.Title, &book.Author, &book.PublicationYear, &book.Genre)
		if err != nil {
			panic(err.Error())
		}
		books = append(books, book)
	}

	json.NewEncoder(w).Encode(books)
}

func getBook(w http.ResponseWriter, r *http.Request) {
	w.Header().Set("Content-Type", "application/json")
	params := mux.Vars(r)

	result, err := db.Query("SELECT id, title, author, publication_year, genre FROM books WHERE id = $1", params["id"])
	if err != nil {
		panic(err.Error())
	}
	defer result.Close()

	var book Book
	for result.Next() {
		err := result.Scan(&book.ID, &book.Title, &book.Author, &book.PublicationYear, &book.Genre)
		if err != nil {
			panic(err.Error())
		}
	}

	json.NewEncoder(w).Encode(book)
}

func createBook(w http.ResponseWriter, r *http.Request) {
	w.Header().Set("Content-Type", "application/json")
	var book Book
	_ = json.NewDecoder(r.Body).Decode(&book)

	err := db.QueryRow("INSERT INTO books (title, author, publication_year, genre) VALUES ($1, $2, $3, $4) RETURNING id;", book.Title, book.Author, book.PublicationYear, book.Genre).Scan(&book.ID)
	if err != nil {
		panic(err.Error())
	}

	json.NewEncoder(w).Encode(book)
}

func updateBook(w http.ResponseWriter, r *http.Request) {
	w.Header().Set("Content-Type", "application/json")
	params := mux.Vars(r)
	var book Book
	_ = json.NewDecoder(r.Body).Decode(&book)

	db.Exec("UPDATE books SET title=$1, author=$2, publication_year=$3, genre=$4 WHERE id=$5", book.Title, book.Author, book.PublicationYear, book.Genre, params["id"])

	result, err := db.Query("SELECT id, title, author, publication_year, genre FROM books WHERE id = $1", params["id"])
	if err != nil {
		panic(err.Error())
	}
	defer result.Close()

	for result.Next() {
		err := result.Scan(&book.ID, &book.Title, &book.Author, &book.PublicationYear, &book.Genre)
		if err != nil {
			panic(err.Error())
		}
	}

	json.NewEncoder(w).Encode(book)
}

func deleteBook(w http.ResponseWriter, r *http.Request) {
	w.Header().Set("Content-Type", "application/json")
	params := mux.Vars(r)

	db.Exec("DELETE FROM books WHERE id = $1", params["id"])

	json.NewEncoder(w).Encode(map[string]string{"result": "success"})
}
```

5. Run the server

Now, you can run your REST API server by executing `go run main.go`. The server will listen on port 8000 and provide endpoints for adding, updating, deleting, and retrieving book information.

You can test the endpoints using tools like Postman or curl.

To design a TypeScript application that fetches weather data from an API like OpenWeatherMap and displays the current temperature, humidity, and wind speed for a given city, follow these steps:

1. Install Node.js and npm (Node Package Manager) if you haven't already.

2. Create a new directory for your project and navigate to it in the terminal/command prompt.

3. Run `npm init` to create a package.json file with default settings.

4. Install TypeScript by running `npm install typescript --save-dev`.

5. Create a tsconfig.json file in your project root directory with the following content:

```json
{
  "compilerOptions": {
    "target": "ES2017",
    "module": "commonjs",
    "strict": true,
    "esModuleInterop": true,
    "outDir": "./dist"
  },
  "include": ["./src/**/*.ts"],
  "exclude": ["node_modules"]
}
```

6. Create a 'src' folder in your project root directory.

7. Inside the 'src' folder, create a main.ts file with the following content:

```typescript
import axios from "axios";

const apiKey = "your_openweathermap_api_key";
const cityName = "New York"; // Replace this with any city name

async function getWeatherData(city: string): Promise<void> {
  try {
    const response = await axios.get(
      `https://api.openweathermap.org/data/2.5/weather?q=${city}&appid=${apiKey}&units=metric`
    );
    const { temp, humidity } = response.data.main;
    const { speed } = response.data.wind;

    console.log(`Temperature: ${temp}°C`);
    console.log(`Humidity: ${humidity}%`);
    console.log(`Wind Speed: ${speed} m/s`);
  } catch (error) {
    console.error("Error fetching weather data:", error);
  }
}

getWeatherData(cityName);
```

Replace "your_openweathermap_api_key" with your actual API key from OpenWeatherMap.

8. Install axios for making HTTP requests by running `npm install axios`.

9. Install the required type definitions for axios and Node.js by running:

```bash
npm install @types/axios --save-dev
npm install @types/node --save-dev
```

10. Compile TypeScript to JavaScript by running `npx tsc` in the terminal/command prompt.

11. Run the compiled JavaScript file using Node.js by running `node dist/main.js`.

You should see the current temperature, humidity, and wind speed for the specified city displayed in the console.

Note: You can replace the cityName variable value with any other city name to fetch the weather data for that city.

```python
from collections import deque

class MovingAverage:
    def __init__(self, size: int):
        self.queue = deque()
        self.maxSize = size
        self.sum = 0.0

    def next(self, val: int) -> float:
        if len(self.queue) == self.maxSize:
            self.sum -= self.queue.popleft()
        self.queue.append(val)
        self.sum += val
        return self.sum / len(self.queue)
```
explanation
The algorithm uses a queue to maintain a sliding window of the last `size` values of the stream. When a new value is added, the algorithm checks the size of the queue. If it equals `size`, the oldest value is removed from the front of the queue by updating the sum and popping it. Then, the new value is added to the back of the queue, and the sum is updated. The average is returned by dividing the sum by the number of values currently in the queue. The time complexity of the `next` function is O(1).

