    return (i + 1 < n and j + 2 < n and k == n * (i + 1) + (j + 2)) or \
           (i + 1 < n and j - 2 >= 0 and k == n * (i + 1) + (j - 2)) or \
           (i + 2 < n and j + 1 < n and k == n * (i + 2) + (j + 1)) or \
           (i + 2 < n and j - 1 >= 0 and k == n * (i + 2) + (j - 1))


def validPath(grid):
    n = len(grid)
    for i in range(n):
        for j in range(n):
            k = grid[i][j]
            if k != n * n - 1 and not isValidMove(i, j, k + 1, n):
                return False
    return True

