From right triangles $ACM$ and $BCN$, we have \begin{align*}
AC^2 + CM^2 &= 36,\\
BC^2 + CN^2 &= (2\sqrt{11})^2 = 44.\end{align*}

However, we have $CM = BC/2$ and $CN = AC/2$, so the equations above become \begin{align*}
AC^2 + \frac14BC^2 &= 36,\\
BC^2 + \frac14AC^2 &=44.
\end{align*}

Adding these equations gives  \[\frac54(AC^2 + BC^2) = 80,\] so $AC^2 + BC^2 = 64$.  But the Pythagorean Theorem gives us $AB^2 = AC^2 + BC^2$, so $AB^2 = 64$, which means $AB = 8$.

