def findBlackPixel(picture, target):
    m, n = len(picture), len(picture[0])
    rows = [0] * m
    cols = [0] * n
    rowCounts = {}
    for i in range(m):
        row = ""
        for j in range(n):
            if picture[i][j] == 'B':
                rows[i] += 1
                cols[j] += 1
            row += picture[i][j]
        if rows[i] == target:
            rowCounts[row] = rowCounts.get(row, 0) + 1
    ans = 0
    for row, count in rowCounts.items():
        if count == target:
            for j in range(n):
                if row[j] == 'B' and cols[j] == target:
                    ans += count
    return ans

```python
def canIWin(maxChoosableInteger, desiredTotal):
    if maxChoosableInteger >= desiredTotal: return True
    if (maxChoosableInteger * (maxChoosableInteger + 1)) // 2 < desiredTotal: return False

    memo = {}

    def canWin(state):
        if state in memo:
            return memo[state]
        for i in range(1, maxChoosableInteger + 1):
            bitCheck = 1 << i
            if (state & bitCheck) == 0:
                if not canWin(state | bitCheck):
                    memo[state] = True
                    return True

        memo[state] = False
        return False

    return canWin(0)
```

explanation
We use a state, represented by an integer where each bit indicates if a number has been taken or not, and store the states in a memoization table. With each function call, we try to take each number from 1 to maxChoosableInteger if it hasn't been taken before, and update the state accordingly. If no moves can be made which forces a win, return false. If the desired total is equal to or less than zero, then the player has lost, and we return false. 

Both players play optimally, so we can recursively call the function for each possible number and check if it doesn't result in a win for the other player. If we find such a scenario, then the first player can force a win. At the end, we return the final result from the memoization table.

