using System;
using Npgsql;

public class BankAccount
{
    public int Id { get; set; }
    public string Name { get; set; }
    public decimal Balance { get; set; }

    // Constructor
    public BankAccount(int id, string name, decimal balance)
    {
        Id = id;
        Name = name;
        Balance = balance;
    }
}

public class DatabaseConnection
{
    private readonly string _connectionString;

    public DatabaseConnection(string connectionString)
    {
        _connectionString = connectionString;
    }

    public void Deposit(int accountId, decimal amount)
    {
        using var conn = new NpgsqlConnection(_connectionString);
        conn.Open();

        using var transaction = conn.BeginTransaction();
        try
        {
            string sql = "UPDATE accounts SET balance = balance + @amount WHERE id = @id";
            using var cmd = new NpgsqlCommand(sql, conn);
            cmd.Parameters.AddWithValue("id", accountId);
            cmd.Parameters.AddWithValue("amount", amount);

            int rowsAffected = cmd.ExecuteNonQuery();
            if (rowsAffected == 0)
                throw new Exception("Account not found.");

            transaction.Commit();
        }
        catch
        {
            transaction.Rollback();
            throw;
        }
    }

    public void Withdraw(int accountId, decimal amount)
    {
        using var conn = new NpgsqlConnection(_connectionString);
        conn.Open();

        using var transaction = conn.BeginTransaction();
        try
        {
            string sql = "UPDATE accounts SET balance = balance - @amount WHERE id = @id AND balance >= @amount";
            using var cmd = new NpgsqlCommand(sql, conn);
            cmd.Parameters.AddWithValue("id", accountId);
            cmd.Parameters.AddWithValue("amount", amount);

            int rowsAffected = cmd.ExecuteNonQuery();
            if (rowsAffected == 0)
                throw new Exception("Insufficient funds or account not found.");

            transaction.Commit();
        }
        catch
        {
            transaction.Rollback();
            throw;
        }
    }

    public BankAccount GetAccountById(int accountId)
    {
        using var conn = new NpgsqlConnection(_connectionString);
        conn.Open();

        string sql = "SELECT id, name, balance FROM accounts WHERE id = @id";
        using var cmd = new NpgsqlCommand(sql, conn);
        cmd.Parameters.AddWithValue("id", accountId);

        using var reader = cmd.ExecuteReader();
        if (!reader.Read())
            throw new Exception("Account not found.");

        return new BankAccount(reader.GetInt32(0), reader.GetString(1), reader.GetDecimal(2));
    }
}

class Program
{
    static void Main(string[] args)
    {
        string connectionString = "Host=localhost;Username=postgres;Password=your_password;Database=bank";
        var db = new DatabaseConnection(connectionString);

        int accountId = 1;
        decimal depositAmount = 1000m;
        decimal withdrawalAmount = 500m;

        Console.WriteLine("Initial balance:");
        BankAccount account = db.GetAccountById(accountId);
        Console.WriteLine($"ID: {account.Id}, Name: {account.Name}, Balance: {account.Balance}");

        Console.WriteLine("\nDepositing...");
        db.Deposit(accountId, depositAmount);
        account = db.GetAccountById(accountId);
        Console.WriteLine($"ID: {account.Id}, Name: {account.Name}, Balance: {account.Balance}");

        Console.WriteLine("\nWithdrawing...");
        db.Withdraw(accountId, withdrawalAmount);
        account = db.GetAccountById(accountId);
        Console.WriteLine($"ID: {account.Id}, Name: {account.Name}, Balance: {account.Balance}");
    }
}

def canConvert(str1, str2):
    if str1 == str2:
        return True
    conversion = {}
    for c1, c2 in zip(str1, str2):
        if c1 in conversion and conversion[c1] != c2:
            return False
        conversion[c1] = c2
    return len(set(str2)) < 26

