The vector $\mathbf{p}$ itself will be orthogonal to the direction vector $\begin{pmatrix} 7 \\ 2 \end{pmatrix},$ so
\[\begin{pmatrix} 7t - 5 \\ 2t + 1 \end{pmatrix} \cdot \begin{pmatrix} 7 \\ 2 \end{pmatrix} = 0.\]Hence, $(7t - 5)(7) + (2t + 1)(2) = 0.$  Solving, we find $t = \frac{33}{53}.$  Hence, $\mathbf{p} = \begin{pmatrix} -34/53 \\ 119/53 \end{pmatrix}.$

