import heapq

class Node:
    def __init__(self, char, freq):
        self.char = char
        self.freq = freq
        self.left = None
        self.right = None

    def __lt__(self, other):
        return self.freq < other.freq


def calc_freq(string):
    freq_dict = {}
    for char in string:
        if char not in freq_dict:
            freq_dict[char] = 0
        freq_dict[char] += 1
    return freq_dict


def build_tree(freq_dict):
    heap = [Node(char, freq) for char, freq in freq_dict.items()]
    heapq.heapify(heap)

    while len(heap) > 1:
        left_node = heapq.heappop(heap)
        right_node = heapq.heappop(heap)
        parent_node = Node(None, left_node.freq + right_node.freq)
        parent_node.left = left_node
        parent_node.right = right_node
        heapq.heappush(heap, parent_node)

    return heap[0]


def generate_codes(node, code, code_dict):
    if node is None:
        return

    if node.char is not None:
        code_dict[node.char] = code
        return

    generate_codes(node.left, code + '0', code_dict)
    generate_codes(node.right, code + '1', code_dict)


def huffman_encode(string):
    freq_dict = calc_freq(string)
    tree_root = build_tree(freq_dict)

    code_dict = {}
    generate_codes(tree_root, '', code_dict)

    encoded_string = ''.join([code_dict[char] for char in string])

    return encoded_string, tree_root


def huffman_decode(encoded_string, tree_root):
    decoded_string = ''
    current_node = tree_root

    for bit in encoded_string:
        if bit == '0':
            current_node = current_node.left
        else:
            current_node = current_node.right

        if current_node.char is not None:
            decoded_string += current_node.char
            current_node = tree_root

    return decoded_string


if __name__ == '__main__':
    input_string = "Huffman coding algorithm"
    encoded_binary, decoding_tree = huffman_encode(input_string)
    print("Encoded binary representation:", encoded_binary)
    print("Decoded string:", huffman_decode(encoded_binary, decoding_tree))

