```javascript
function generateFibonacci(limit) {
  const sequence = [0, 1];

  while (sequence[sequence.length - 1] + sequence[sequence.length - 2] <= limit) {
    sequence.push(sequence[sequence.length - 1] + sequence[sequence.length - 2]);
  }

  return sequence;
}

