import sys

def dijkstra(graph, start_vertex):
    n = len(graph)
    shortest_paths = [sys.maxsize] * n
    shortest_paths[start_vertex] = 0
    visited_vertices = []

    for _ in range(n - 1):
        min_distance = sys.maxsize
        for i in range(n):
            if shortest_paths[i] < min_distance and i not in visited_vertices:
                u = i
                min_distance = shortest_paths[i]

        visited_vertices.append(u)

        for k in range(n):
            if (graph[u][k] != 0) and (k not in visited_vertices):
                new_distance = shortest_paths[u] + graph[u][k]
                if new_distance < shortest_paths[k]:
                    shortest_paths[k] = new_distance

    return shortest_paths


if __name__ == "__main__":
    # Example graph represented as an adjacency matrix
    graph = [
        [0, 10, 20, 0, 0],
        [10, 0, 5, 16, 0],
        [20, 5, 0, 20, 1],
        [0, 16, 20, 0, 2],
        [0, 0, 1, 2, 0]
    ]

    start_vertex = 0
    shortest_paths = dijkstra(graph, start_vertex)

    print("Shortest paths from vertex {}:".format(start_vertex))
    for i, distance in enumerate(shortest_paths):
        print("To vertex {}: {}".format(i, distance))

