def hasPath(maze, start, destination):
    dirs = ((0, 1), (0, -1), (1, 0), (-1, 0))
    q = [start]
    while q:
        x, y = q.pop(0)
        if x == destination[0] and y == destination[1]:
            return True
        for dx, dy in dirs:
            i, j = x, y
            while 0 <= i + dx < len(maze) and 0 <= j + dy < len(maze[0]) and maze[i + dx][j + dy] == 0:
                i += dx
                j += dy
            if maze[i][j] == 0:
                maze[i][j] = 1
                q.append((i, j))
    return False
```
explanation
The given problem can be solved using Breadth First Search (BFS). We start from the starting point, and at each step, we keep rolling in all possible directions (up, down, left, and right) till we hit a wall. We then add the final point (before hitting the wall) of each direction to the queue if it has not been visited before. If the destination is encountered while rolling, we return True. If the queue becomes empty, that means we have exhausted all possible rollings, and thus return False. In each language (C++, Java, Python, and JavaScript), we implement this BFS algorithm using the same logic inside a while loop, keeping track of the visited positions in the maze matrix itself by marking them as 1.

