import random

class Solution:

    def __init__(self, nums):
        self.nums = nums

    def pick(self, target):
        count, res = 0, 0
        for i, num in enumerate(self.nums):
            if num == target:
                count += 1
                if random.randint(0, count - 1) == 0:
                    res = i
        return res
```
explanation
The algorithm iterates through the input array and whenever it finds the target element, it increments the count variable. It then generates a random number in the range `[0, count - 1]`. If the random number is 0, set the result to the current index. Since the random generator function may generate 0 multiple times during the iteration, this makes sure that the final result is randomly picked among all occurrences of the target.

At the end of the loop, the variable `res` contains the randomly picked index of the target value. The time complexity of this algorithm is O(n) and space complexity is O(1).

