Drop perpendiculars from $P$ and $S$ to $X$ and $Z$, respectively, on side $AC$. Since $PS$ is parallel to $AC$, and $PX$ and $SZ$ are perpendicular to $AC$, we know that $PXZS$ is a rectangle, so $XZ=PS=2$.

Since $\triangle AXP$ is right-angled at $X$, has $PX=1$ (the radius of the circle), and $\angle PAX=45^\circ$, we have $AX=PX=1$. Since $\triangle CZS$ is right-angled at $Z$, has $SZ=1$ (the radius of the circle), and $\angle SCZ=30^\circ$, we have $CZ=\sqrt{3}SZ=\sqrt{3}$ (since $\triangle SZC$ is also a $30^\circ$-$60^\circ$-$90^\circ$ triangle). Thus, $AC=1+2+\sqrt{3}=3+\sqrt{3}$.

Since $\triangle ABC$ is a $30^\circ$-$60^\circ$-$90^\circ$ triangle, with $\angle ACB=60^\circ$ and $\angle CAB=90^\circ$, we have $BC=2AC=6+2\sqrt{3}$, and $$AB=\sqrt{3}AC=\sqrt{3}(3+\sqrt{3})=3\sqrt{3}+3.$$Therefore, the side lengths of $\triangle ABC$ are $AC=3+\sqrt{3}$, $AB=3\sqrt{3}+3$, and $BC=6+2\sqrt{3}$. Thus, the perimeter is $$3+\sqrt{3}+3\sqrt{3}+3+6+2\sqrt{3}=12+6\sqrt{3}.$$

