The vector $\mathbf{p}$ itself will be orthogonal to the direction vector $\begin{pmatrix} -1 \\ 4 \\ -2 \end{pmatrix},$ so
\[\begin{pmatrix} -t + 1 \\ 4t - 1 \\ -2t + 2 \end{pmatrix} \cdot \begin{pmatrix} -1 \\ 4 \\ -2 \end{pmatrix} = 0.\]Hence, $(-t + 1)(-1) + (4t - 1)(4) + (-2t + 2)(-2) = 0.$  Solving, we find $t = \frac{3}{7}.$  Hence, $\mathbf{p} = \begin{pmatrix} 4/7 \\ 5/7 \\ 8/7 \end{pmatrix}.$

package main

import (
	"bytes"
	"context"
	"fmt"
