def maxAbsoluteSum(nums):
    max_sum, min_sum, max_so_far, min_so_far = 0, 0, 0, 0
    for num in nums:
        max_so_far = max(num, max_so_far + num)
        max_sum = max(max_sum, max_so_far)

        min_so_far = min(num, min_so_far + num)
        min_sum = min(min_sum, min_so_far)
    return max(max_sum, abs(min_sum))

```python
from collections import deque

class HitCounter:

    def __init__(self):
        self.queue = deque()

    def hit(self, timestamp: int) -> None:
        self.queue.append(timestamp)

    def getHits(self, timestamp: int) -> int:
        while self.queue and self.queue[0] <= timestamp - 300:
            self.queue.popleft()
        return len(self.queue)
```
explanation
The key to solving this problem is maintaining a queue with hit timestamps. Since the timestamps are monotonically increasing, we can simply simulate the moving window by removing hits that are no longer within the last 300 seconds for a given timestamp.

1. Implement the `HitCounter` class with a queue-like data structure (e.g., `deque`, `queue`, `list`, `linkedlist`)
2. For `hit(timestamp)`, add the timestamp to the tail of the queue.
3. For `getHits(timestamp)`, iterate through the timestamps from the head of the queue and remove any timestamp that is not within the last 300 seconds (i.e., <= current_timestamp - 300). Then return the number of timestamps left in the queue (i.e., the size of the queue).

